syntax = "proto3";
package TFGProtocol;

import "google/protobuf/timestamp.proto";
option csharp_namespace = "TFG.Protobuf";

message DadaGenerada 
{
	double valor=1;
	google.protobuf.Timestamp dataGeneracio=2;
}

message DadaTractada
{
	string valor=1;
	google.protobuf.Timestamp dataGeneracio=2;
}


